// create simple page to display Hello World
import React from 'react';

const Chart = () => {
  return (
    <div>
      <script src="https://cdnjs.cloudflare.com/ajax/libs/Chart.js/2.9.4/Chart.js"> 
      </script>
      <h1>People</h1>
      
    </div>
  )
}

export default Chart;
